A toast to the bride and groom (the daughter of my dear friend @lisaschiftgreen )…two drifters off to see the world, may it be your oyster, filled with Huckleberry friends,and may your cup of coffee that Austin brings you every morning runneth over with laughter, and adventure, and so much love snd  may all the dreams that you dream be dreams that really do come true, and may  the love that you share be a love thats here to stay …at last. ( all your favorite songs referenced for  this toast ) #emmaandaustinforever 💕 
@emmag263 @om_em_g 
✨PS I had so much fun photographing you two lovebirds 🤍🤍🕊🕊❤️❤️💕✨
